import { Modal } from "@mui/material";
import React from "react";

const EditModal = ({ open, handelModalClose }) => {
  return (
    <Modal open={open}>
      <div style={{ height: "20%", width: "25%", background: "white" }}>
        <p style={{ color: "red" }} onClick={handelModalClose}>
          close
        </p>
      </div>
    </Modal>
  );
};

export default EditModal;
